import React, { useEffect, useState } from 'react';
import Map from './components/Map';
import Stats from './components/Stats';
import { City, MigrationFlow, MigrationStats, CityStats } from './types';
import './App.css';

const API_BASE_URL = 'http://localhost:8000/api/v1';

const App = () => {
    const [cities, setCities] = useState<City[]>([]);
    const [migrationFlows, setMigrationFlows] = useState<MigrationFlow[]>([]);
    const [migrationStats, setMigrationStats] = useState<MigrationStats | null>(null);
    const [selectedCity, setSelectedCity] = useState<string | undefined>();
    const [cityStats, setCityStats] = useState<CityStats | null>(null);
    const [isLoading, setIsLoading] = useState(true);
    const [error, setError] = useState<string | null>(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                setIsLoading(true);
                setError(null);

                // Завантаження міст
                const citiesResponse = await fetch(`${API_BASE_URL}/cities`);
                if (!citiesResponse.ok) throw new Error('Помилка завантаження міст');
                const citiesData = await citiesResponse.json();
                setCities(citiesData);

                // Завантаження потоків міграції
                const flowsResponse = await fetch(`${API_BASE_URL}/migration/flows`);
                if (!flowsResponse.ok) throw new Error('Помилка завантаження потоків міграції');
                const flowsData = await flowsResponse.json();
                setMigrationFlows(flowsData);

                // Завантаження загальної статистики
                const statsResponse = await fetch(`${API_BASE_URL}/migration/stats`);
                if (!statsResponse.ok) throw new Error('Помилка завантаження статистики');
                const statsData = await statsResponse.json();
                setMigrationStats(statsData);
            } catch (err) {
                setError(err instanceof Error ? err.message : 'Сталася помилка при завантаженні даних');
                console.error('Помилка:', err);
            } finally {
                setIsLoading(false);
            }
        };

        fetchData();
    }, []);

    useEffect(() => {
        const fetchCityStats = async () => {
            if (!selectedCity) {
                setCityStats(null);
                return;
            }

            try {
                const response = await fetch(`${API_BASE_URL}/cities/${selectedCity}/stats`);
                if (!response.ok) throw new Error('Помилка завантаження статистики міста');
                const data = await response.json();
                setCityStats(data);
            } catch (err) {
                console.error('Помилка завантаження статистики міста:', err);
                setCityStats(null);
            }
        };

        fetchCityStats();
    }, [selectedCity]);

    if (isLoading) {
        return (
            <div className="app">
                <header className="app-header">
                    <h1>Migratio Map - Аналіз міграції в Україні</h1>
                </header>
                <main className="app-main">
                    <div className="loading">Завантаження...</div>
                </main>
            </div>
        );
    }

    if (error) {
        return (
            <div className="app">
                <header className="app-header">
                    <h1>Migratio Map - Аналіз міграції в Україні</h1>
                </header>
                <main className="app-main">
                    <div className="error">
                        <h2>Помилка</h2>
                        <p>{error}</p>
                        <p>Переконайтеся, що бекенд сервер запущений на порту 8000</p>
                    </div>
                </main>
            </div>
        );
    }

    return (
        <div className="app">
            <header className="app-header">
                <h1>Migratio Map - Аналіз міграції в Україні</h1>
            </header>
            <main className="app-main">
                <div className="map-container">
                    <Map
                        cities={cities}
                        migrationFlows={migrationFlows}
                        selectedCity={selectedCity}
                        onCitySelect={setSelectedCity}
                    />
                </div>
                <div className="stats-container">
                    {migrationStats && (
                        <Stats
                            migrationStats={migrationStats}
                            cityStats={cityStats || undefined}
                        />
                    )}
                </div>
            </main>
        </div>
    );
};

export default App;
